<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Product Grid Layout</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      margin: 0;
      background: #f2f2f2;
    }

    .container {
      display: flex;
    }
ss
    .sidebar {
      width: 200px;
      background: #e8e8e8;
      padding: 20px;
    }

    .sidebar h3 {
      margin-top: 0;
    }

    .sidebar ul {
      list-style: none;
      padding: 0;
    }

    .sidebar li {
      margin: 10px 0;
      cursor: pointer;
    }

    .content {
      flex: 1;
      padding: 20px;
    }

    .top-bar {
      display: flex;
      justify-content: flex-end;
      margin-bottom: 20px;
    }

    .top-bar input[type="text"] {
      padding: 8px;
      width: 200px;
    }

    .product-grid {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(180px, 1fr));
      gap: 20px;
    }

    .product {
      background: white;
      border-radius: 5px;
      padding: 10px;
      text-align: center;
      box-shadow: 0 0 5px rgba(0,0,0,0.1);
    }

    .product img {
      max-width: 100%;
      height: auto;
    }

    .product h4 {
      margin: 10px 0 5px;
    }

    .product p {
      margin: 5px 0;
    }

    .add-to-cart {
      background: #333;
      color: white;
      padding: 5px 10px;
      border: none;
      margin-top: 10px;
      cursor: pointer;
    }

    .stars {
      color: #ccc;
      font-size: 14px;
    }
  </style>
</head>
<body>

<div class="container">
  <div class="sidebar">
    <ul>
      <li>New Arrivals</li>
      <li>Brand</li>
      <li>Best Selling</li>
      <li><strong>Featured Collection</strong></li>
      <li>Top Offers</li>
      <li>Hot Deals</li>
      <hr>
      <li>My Account</li>
      <li>Our Stores</li>
      <li>Delivery</li>
      <li>View All</li>
    </ul>
  </div>

  <div class="content">
    <div class="top-bar">
      <input type="text" placeholder="Search...">
    </div>
